import './App.css';
import Todo from './component/home.jsx';
import {
  BrowserRouter as Router,
  Route,
  Routes
} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Router>

        <Routes>
              <Route exact path="/" element={<Todo />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
